import { ProSidebar, Menu, MenuItem } from 'react-pro-sidebar';
import { Link } from 'react-router-dom';
import React from 'react';

const SideBarMenu = () => {
    const [active, setActive] = React.useState('home');

    return (
        <ProSidebar>
          <Menu iconShape="square">
            <MenuItem>
                Profile
                <Link to="/profile" />
            </MenuItem>
            <MenuItem>
                News
                <Link to="/newsFeed" />
            </MenuItem>
          </Menu>
        </ProSidebar>
    );
}

export default SideBarMenu;
